PREFIX kwaliteit: <https://data.labs.kadaster.nl/bag/kwaliteit/model/def/>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT (count(distinct ?sub) as ?objecten) ?gemeente WHERE {
  ?sub dct:source ?source;
       kwaliteit:gemeente/rdfs:label ?gemeente.

}
order by desc(?objecten)
